def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentences = []
    subject = triples[0].subject if triples else ""
    for i, triple in enumerate(triples):
        predicate = triple.predicate
        object_val = triple.object

        if i == 0:
            sentence = f"{subject} "
            if predicate == "league":
                sentence += f"plays in the {object_val} "
            elif predicate == "manager":
                sentence += f"is managed by {object_val} "
            elif predicate == "birthDate":
                sentence += f"was born on {object_val} "
            elif predicate == "birthPlace":
                sentence += f"was born in {object_val} "
            elif predicate == "currentclub":
                sentence += f"currently plays for {object_val} "
            else:
                sentence += f"has a {predicate} of {object_val} "
            sentences.append(sentence)
        else:
            if predicate == "league":
                sentences[-1] += f"and plays in the {object_val} "
            elif predicate == "manager":
                sentences[-1] += f"and is managed by {object_val} "
            elif predicate == "birthDate":
                sentences[-1] += f"and was born on {object_val} "
            elif predicate == "birthPlace":
                sentences[-1] += f"and was born in {object_val} "
            elif predicate == "currentclub":
                sentences[-1] += f"and currently plays for {object_val} "
            else:
                if predicate == "country":
                    sentences[-1] += f"and is from {object_val} "
                elif predicate == "city":
                    sentences[-1] += f"and plays in {object_val} "
                else:
                    sentences[-1] += f"and their {predicate} is {object_val} "

    combined_sentence = sentences[0] if sentences else ""
    for i in range(1, len(sentences)):
        combined_sentence += ", and " + sentences[i]
    return combined_sentence + "."

